        var resNo = this.mState.HaveInRoom();
        if (resNo !== 0)
            return resNo;
        if (groups.length <= 0)
            return -20;
        if (data.length > 1024)
            return -21;
        var priority = 1; // 要设置的消息通道优先级
        var buf = this.mProtocol.sendEventGroup(M_EVN.gameID, this.mRoomInfo.getRoomid(), priority, groups, data);
